import { useEffect } from "react";
import PlacesCard from "./PlacesCard";
import {
  Box,
  Typography,
  Button,
  Card,
  CardMedia,
  CardContent,
  CardActions,
  Chip,
  Grid,
  FormControl,
  InputLabel,
  MenuItem,
  Select,
} from "@material-ui/core";

const PlacesContainer = ({ savedPlaces, setSavedPlaces, handleDelete }) => {
  useEffect(() => {
    fetch("/places").then((res) => {
      if (res.ok) {
        res.json().then((data) => setSavedPlaces(data));
      } else {
        res.json().then((errors) => console.log(errors));
      }
    });
  }, []);

  const mapSavedPlaces = savedPlaces.map((myPlace) => {
    return (
      <PlacesCard
        key={myPlace.id}
        id={myPlace.id}
        myPlace={myPlace}
        handleDelete={handleDelete}
      />
    );
  });

  return (
    <Box
      container
      noValidate
      sx={{ mt: 3 }}
      style={{ justifyContent: "center" }}
    >
      <FormControl className={classes.formControl}>
        <InputLabel>Type</InputLabel>
        <Select value={type} onChange={(e) => setType(e.target.value)}>
          <MenuItem value="restaurants">Restaurants</MenuItem>
          <MenuItem value="hotels">Hotels</MenuItem>
          <MenuItem value="attractions">Attractions</MenuItem>
        </Select>
      </FormControl>
      <FormControl className={classes.formControl}>
        <InputLabel>Rating</InputLabel>
        <Select>
          <MenuItem value={0}>All</MenuItem>
          <MenuItem value={3}>Above 3.0</MenuItem>
          <MenuItem value={4}>Above 4.0</MenuItem>
        </Select>
      </FormControl>
      <Typography gutterBottom variant="h5">
        My Places
      </Typography>
      <Grid item xs={12} sx={{ mt: 3 }} align="center">
        {mapSavedPlaces}
      </Grid>
    </Box>
  );
};

export default PlacesContainer;
